import React, { Component } from 'react'
import './Home.css'
import homimg1 from '../assets/hero_image.png'
import homimg2 from '../assets/hero_image_back.png'


export default class home extends Component {
  render() {
    return (
      <div className='home'>
        
        <div class="media">
            <div class="media-body">
                <h5>Media heading</h5>
                Media text
            </div>
           
        </div>
      
      
      </div>
    )
  }
}
